import './App.css';
import { Home } from './Pages/Home';
import { AboutMe } from './Pages/AboutMe';
import { BrowserRouter, Switch, Route, Redirect } from 'react-router-dom';
import NavBar from './Components/navBar/NavBar';


function App() {
  return (
    <BrowserRouter className="App">
                  <NavBar />

      <Switch>
        <Route path='/home'>
          <Home />
        </Route>
        <Route path='/aboutMe'>
          <AboutMe />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
